import React, { useEffect, useState } from 'react'
import './style.css';
import FavoriteItem from '../../../Components/FavoriteItem';
import { FavoriteListMock, commentListMock } from '../../../Mocks';
import favoriteListItem from '../../../Types/Interface/Favorite-List-Item.interface';
import { commentListItem } from '../../../Types/Interface';
import CommentItem from '../../../Components/CommentItem';
import Pagination from '../../../Components/Pagination';



// component: 게시물 상세화면 컴포넌트 
export default function BoardDetail() {




// component: 게시물 상세 상단 컴포넌트 
const BoardDetailTop =()=>{

// render: 게시물 상세 상단 컴포넌트 렌더링 
  return(
    <div id='board-detail-top'>
        <div className='board-detail-top-header'>
              <div className='board-detail-title'>{'제목입니다 여러분'}</div>
              <div className='board-detail-top-sub-box'>
                 <div className='board-detail-write-info-box'>
                      <div className='board-detail-writer-profile-image'></div>
                      <div className='board-detail-writer-nickname'>{'닉네임 입니다'}</div>
                      <div className='board-detail-info-divider'>{'\|'}</div>
                      <div className='board-detail-write-date'>{'2024. 02. 1.'}</div>
                 </div>
                 <div className='Icon-Button'>
                      <div className='Icon more-icon'></div>
                 </div>
                 <div className='board-detail-more-box'>
                      <div className='board-detail-update-box'>{'수정'}</div>
                      <div className='divider'></div>
                      <div className='board-detail-delete-button'>{'삭제'}</div>
                 </div>
              </div>
        </div>
        <div className='divider'></div>
        <div className='board-detail-top-main'>
            <div className='board-detail-main-text'>{'내용입니다.'}</div>
            <div className='board-detail-main-image'></div>
        </div>



    </div>
  );
}



// component: 게시물 상세 하단 컴포넌트 
const BoardDetailBottom=()=>{

const [favoriteList,setFavoriteList]=useState<favoriteListItem[]>([]);
const [commentList, setCommentList]=useState<commentListItem[]>([]);
useEffect(()=>{
setFavoriteList(FavoriteListMock);
setCommentList(commentListMock);
},[])


// render: 게시물 상세 하단 컴포넌트 렌더링 

};
// render: 게시물 상세 하단 컴포넌트 렌더링 
return (
  <div id='board-detail-bottom' style={{ border: '1px solid #000', padding: '10px' }}>
    <div className='board-detail-bottom-box' style={{ border: '1px solid #000', padding: '10px' }}>
      <div className='board-detail-bottom-button-group' style={{ border: '1px solid #000', padding: '10px', marginBottom: '10px' }}>
        <div className='Icon-Button' style={{ border: '1px solid #000', padding: '10px' }}>
          <div className='Icon favorite-fill-icon'></div>
        </div>
        <div className='board-detail-bottom-button-text' style={{ border: '1px solid #000', padding: '10px' }}>{`좋아요${12}`}</div>
        <div className='Icon-Button' style={{ border: '1px solid #000', padding: '10px' }}>
          <div className='Icon up-light-icon'></div>
        </div>
      </div>
      <div className='board-detail-bottom-button-group' style={{ border: '1px solid #000', padding: '10px' }}>
        <div className='Icon-Button' style={{ border: '1px solid #000', padding: '10px' }}>
          <div className='Icon comment-icon'></div>
        </div>
        <div className='board-detail-bottom-button-text' style={{ border: '1px solid #000', padding: '10px' }}>{`댓글${12}`}</div>
        <div className='Icon-Button' style={{ border: '1px solid #000', padding: '10px' }}>
          <div className='Icon up-light-icon'></div>
        </div>
      </div>
    </div>
    <div className='board-detail-bottom-favorite-box' style={{ border: '1px solid #000', padding: '10px', marginBottom: '10px' }}>
      <div className='board-detail-bottom-favorite-container' style={{ border: '1px solid #000', padding: '10px' }}>
        <div className='board-detail-bottom-favorite-title'>{`좋아요 ${12}`}</div>
        <div className='board-detail-bottom-favorite-contents'>
          {avoriteList.map(a => <FavoriteItem FavoriteListItem={a} />)}
        </div>
      </div>
    </div>
    <div className='board-detail-bottom-comment-box' style={{ border: '1px solid #000', padding: '10px' }}>
      <div className='board-detail-bottom-comment-container' style={{ border: '1px solid #000', padding: '10px' }}>
        <div className='board-detail-bottom-comment-title'>{`댓글 ${12}`}</div>
        <div className='board-detail-bottom-list-container'>
          {commentList.map(a => <CommentItem commentListItem={a} />)}
        </div>
      </div>
      <div className='divider' style={{ border: '1px solid #000', margin: '10px' }}></div>
      <div className='board-detail-bottom-pagination-box' style={{ border: '1px solid #000', padding: '10px', marginBottom: '10px' }}>
        <Pagination />
      </div>
      <div className='board-detail-bottom-comment-input-container' style={{ border: '1px solid #000', padding: '10px' }}>
        <div className='board-detail-bottom-comment-input-container'>
          <textarea className='board-detail-bottom-comment-textarea' placeholder='댓글을 작성해주세요.' />
          <div className='board-detail-bottom-comment-button-box'>
            <div className='disable-button'>{`댓글 달기.`}</div>
          </div>
        </div>
      </div>
    </div>
  </div>
);



// render: 게시물 상세화면 컴포넌트 렌더링 
  return (
    <div id='board-detail-wrapper'>
      <div className='board-detail-container'>
          <BoardDetailTop/>
          <BoardDetailBottom/>
      </div>
    </div>
  )
}
